$(function(){$('a[href^="#"]').on("click",function(b){var a=$($(this).attr("href"));if(a.length){b.preventDefault();$("html, body").animate({scrollTop:(a.offset().top-90)},"fast","swing")}});var f=0;var e=3;$(function d(){f++;if(f>=e){f=0}$(".carousel").each(function(){var a=$(this);a.fadeOut(1000,function(){a.css("background-image","url(static/img/menuphoto/"+a.attr("id")+"-"+(f+1)+".jpg)");a.fadeIn(1000,false)})});setTimeout(d,5000)})});